Я работаю с запросами:
- Состояние тревоги и неуверенности;
- Проблемы во взаимоотношениях с партнёром, детьми, коллегами;
- Получение желаемого уровня дохода;
- Самоопределение и поиск своего пути;
- И другие запросы;

Записывайтесь на консультацию и мы, индивидуальным подходом, решим вашу задачу.
